SET NOCOUNT ON;

-- Datenbank (erneut) anlegen und wechseln
USE [master];
IF EXISTS (SELECT * FROM [sys].[databases] WHERE [name] = 'dotnetconsulting_Videogames')
BEGIN
	ALTER DATABASE [dotnetconsulting_Videogames] SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
	DROP DATABASE [dotnetconsulting_Videogames];
	PRINT '''dotnetconsulting_Videogames''-Datenbank gelöscht';
END
GO
CREATE DATABASE [dotnetconsulting_Videogames];
GO
USE [dotnetconsulting_Videogames];
PRINT '''dotnetconsulting_Videogames''-Datenbank erstellt und gewechselt';
GO

GO
SET ANSI_NULLS, ANSI_PADDING, ANSI_WARNINGS, ARITHABORT, CONCAT_NULL_YIELDS_NULL, QUOTED_IDENTIFIER ON;

SET NUMERIC_ROUNDABORT OFF;


GO
PRINT N'Erstelle [dbo].[Highscores]...';


GO
CREATE TABLE [dbo].[Highscores] (
    [ID]           INT      IDENTITY (1, 1) NOT NULL,
    [SpielerID]    INT      NOT NULL,
    [VideospielID] INT      NOT NULL,
    [Punkte]       INT      NOT NULL,
    [Zeitpunkt]    DATETIME NOT NULL,
    CONSTRAINT [PK_Highscore] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Erstelle [dbo].[Laender]...';


GO
CREATE TABLE [dbo].[Laender] (
    [ID]   INT          IDENTITY (1, 1) NOT NULL,
    [Land] VARCHAR (50) NULL,
    CONSTRAINT [PK_Laender] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Erstelle [dbo].[Spieler]...';


GO
CREATE TABLE [dbo].[Spieler] (
    [ID]              INT          IDENTITY (1, 1) NOT NULL,
    [HerkunftslandID] INT          NULL,
    [Name]            VARCHAR (50) NOT NULL,
    [Nickname]        VARCHAR (50) NOT NULL,
    [Aktiv]           BIT          NOT NULL,
	[MitgliedSeit]	  DATE         NULL
    CONSTRAINT [PK_Spieler] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Erstelle [dbo].[Videospiele]...';


GO
CREATE TABLE [dbo].[Videospiele] (
    [ID]   INT          IDENTITY (1, 1) NOT NULL,
    [Name] VARCHAR (50) NULL,
    CONSTRAINT [PK_Games] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Erstelle [dbo].[DF_Spieler_Aktiv]...';


GO
ALTER TABLE [dbo].[Spieler]
    ADD CONSTRAINT [DF_Spieler_Aktiv] DEFAULT ((1)) FOR [Aktiv];


GO
PRINT N'Erstelle [dbo].[FK_Highscores_Spieler]...';


GO
ALTER TABLE [dbo].[Highscores] WITH NOCHECK
    ADD CONSTRAINT [FK_Highscores_Spieler] FOREIGN KEY ([SpielerID]) REFERENCES [dbo].[Spieler] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE;


GO
PRINT N'Erstelle [dbo].[FK_Highscores_Games]...';


GO
ALTER TABLE [dbo].[Highscores] WITH NOCHECK
    ADD CONSTRAINT [FK_Highscores_Games] FOREIGN KEY ([VideospielID]) REFERENCES [dbo].[Videospiele] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE;


GO
PRINT N'Erstelle [dbo].[FK_Spieler_Laender]...';


GO
ALTER TABLE [dbo].[Spieler] WITH NOCHECK
    ADD CONSTRAINT [FK_Spieler_Laender] FOREIGN KEY ([HerkunftslandID]) REFERENCES [dbo].[Laender] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE;


GO
PRINT N'Tabellen angelegt.';

PRINT N'Daten einfügen'
BEGIN TRANSACTION
ALTER TABLE [dbo].[Highscores] DROP CONSTRAINT [FK_Highscores_Spieler]
ALTER TABLE [dbo].[Highscores] DROP CONSTRAINT [FK_Highscores_Games]
ALTER TABLE [dbo].[Spieler] DROP CONSTRAINT [FK_Spieler_Laender]
SET IDENTITY_INSERT [dbo].[Laender] ON
SET IDENTITY_INSERT [dbo].[Laender] OFF
SET IDENTITY_INSERT [dbo].[Spieler] ON
SET IDENTITY_INSERT [dbo].[Spieler] OFF
SET IDENTITY_INSERT [dbo].[Videospiele] ON
SET IDENTITY_INSERT [dbo].[Videospiele] OFF
SET IDENTITY_INSERT [dbo].[Highscores] ON
SET IDENTITY_INSERT [dbo].[Highscores] OFF
ALTER TABLE [dbo].[Highscores]
    WITH NOCHECK ADD CONSTRAINT [FK_Highscores_Spieler] FOREIGN KEY ([SpielerID]) REFERENCES [dbo].[Spieler] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE
ALTER TABLE [dbo].[Highscores]
    WITH NOCHECK ADD CONSTRAINT [FK_Highscores_Games] FOREIGN KEY ([VideospielID]) REFERENCES [dbo].[Videospiele] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE
ALTER TABLE [dbo].[Spieler]
    WITH NOCHECK ADD CONSTRAINT [FK_Spieler_Laender] FOREIGN KEY ([HerkunftslandID]) REFERENCES [dbo].[Laender] ([ID]) ON DELETE CASCADE ON UPDATE CASCADE
COMMIT TRANSACTION

PRINT 'Daten eingefügt.'
